class Solution:
    def longestponlindrom(self,s):
        len1 = len(s)
        ansString = currentString = ''
        for i in range(len1):
            start = i
            end = i
            try:
                while s[start] == s[end]:
                    print(i,start, end)
                    currentString = s[start:end+1]
                    print('current', currentString)
                    start -= 1
                    end += 1
                    if start < 0 or  end >= len1:
                            raise StopIteration
            except StopIteration:
                pass

            print('current',currentString)

            if len(ansString) < len(currentString):
                ansString = currentString
        return ansString



